using BenchmarkDotNet.Attributes;
using Grpc.Net.Client;
using System.Net.Http.Json;

namespace TestProject
{
    [MemoryDiagnoser]
    public class Tester
    {
        private static GrpcChannel? channel;
        private static readonly string GrpcAddress = "http://localhost:5280";
        private static readonly string RestAddress = "https://localhost:7122/";

        [GlobalSetup]
        public void GlobalSetup()
        {
            channel = GrpcChannel.ForAddress(GrpcAddress);
        }

        [Benchmark]
        public void GrpcWithChannelTest()
        {
            var internalClient = new Message.MessageClient(channel);
            _ = internalClient.SendMessage(new MessageContent { Header = $"header1", Body = $"body1" });
        }

        [Benchmark]
        public void GrpcWithChannelCreationTest()
        {
            GrpcChannel internalChannel = GrpcChannel.ForAddress(GrpcAddress);
            try
            {
                var internalClient = new Message.MessageClient(internalChannel);
                _ = internalClient.SendMessage(new MessageContent { Header = $"header1", Body = $"body1" });
                internalChannel.ShutdownAsync().Wait();
            }
            catch
            {
                //continue
            }
        }

        [Benchmark]
        public void GrpcWithChannelCreationMultipleHttp2EnabledTest()
        {
            var internalChannel = GrpcChannel.ForAddress(GrpcAddress, new GrpcChannelOptions
            {
                HttpHandler = new SocketsHttpHandler
                {
                    EnableMultipleHttp2Connections = true
                }
            });

            try
            {
                var internalClient = new Message.MessageClient(internalChannel);
                _ = internalClient.SendMessage(new MessageContent { Header = $"header1", Body = $"body1" });
                internalChannel.ShutdownAsync().Wait();
            }
            catch
            {
                //continue
            }
        }

        [Benchmark]
        public void GrpcBigMessageWithChannelTest()
        {
            var client = new Message.MessageClient(channel);
            _ = client.SendBigMessage(GetBigContent());
        }

        [Benchmark]
        public void RestTest()
        {
            using var client = new HttpClient();
            MessageContent p = new() { Header = $"header1", Body = $"body1" };
            client.BaseAddress = new Uri(RestAddress);
            _ = client.PostAsJsonAsync("sendMessage", p).Result;
            client.Dispose();
        }

        [Benchmark]
        public void RestBigMessageTest()
        {
            try
            {
                using var client = new HttpClient();
                client.BaseAddress = new Uri(RestAddress);
                var response = client.PostAsJsonAsync("sendBigMessage", GetBigContent()).Result;
            }
            catch
            {
                //continue
            }
        }

        private static MessageBigContent GetBigContent()
        {
            return new MessageBigContent
            {
                Prop1 = "",
                Prop2 = "",
                Prop3 = "",
                Prop4 = "",
                Prop5 = "",
                Prop6 = "",
                Prop7 = "",
                Prop8 = "",
                Prop9 = "",
                Prop10 = "",
                Prop11 = "",
                Prop12 = "",
                Prop13 = "",
                Prop14 = "",
                Prop15 = "",
                Prop16 = "",
                Prop17 = "",
                Prop18 = "",
                Prop19 = "",
                Prop20 = "",
            };
        }

        [GlobalCleanup]
        public void GlobalCleanup()
        {
            if (channel != null && channel.State != Grpc.Core.ConnectivityState.Shutdown)
                channel.ShutdownAsync().Wait();
        }
    }
}